import React from 'react';
const ListaImagenes = ({fotos}) => {
    return ( 
        <div>
        {fotos.map((foto) => (
            <div className="card">
                <img key={foto.id} src={foto.urls.small} alt={foto.alt_description} />
            </div>
        ))}
      </div>
     );
}
 
export default ListaImagenes;
